import React from 'react'
import {Link} from 'react-router-dom'
const MenuButton = (props) => {
  const {
    button_text,
    image,
    color,
    link_to
    } = props
    
  return (
    <div>
        <Link to ={link_to}>
            <button 
                type = 'button' 
                className='menu-button'
                > {button_text}
            </button>
        </Link>
    </div>
  )
}

export default MenuButton
